import PropTypes from 'prop-types'

const Button = (props) => {
    return (
        <button className='button-class' style={{width:props.width,color:props.color}}>
            {props.text}
        </button>
    )
}

Button.propTypes = {
    color: PropTypes.string,
    text: PropTypes.string,
    onClick: PropTypes.func,
}
Button.defaultProps = {
    color: 'steelblue',
    width: '50%',
}

export default Button
